import { describe } from "mocha";

import reverse from "./7.Reverse_Integer";

describe('reverse()', () => {
   it('returns the numbers in reverse order', () => {
        const expected = 321;
        const actual = reverse(123);
        expect(actual).to.deep.equal(expected);
   });

    it('returns negative numbers in reverse order', () => {
        const expected = -321;
        const actual = reverse(-123);
        expect(actual).to.deep.equal(expected);
    });

    it('returns the numbers with ending zeros in reverse order', () => {
        const expected = 21;
        const actual = reverse(120);
        expect(actual).to.deep.equal(expected);
    });

    it('returns the numbers with ending zeros in reverse order', () => {
        const expected = "21";
        const actual = reverse(120);
        expect(actual).to.deep.equal(expected);
    });
});

